import React from 'react';
import {connect} from 'react-redux';

class SongList extends React.Component{
	render(){
		return (
			<div>Song List</div>
		);
	}
}

const mapStateToProps = state => {
	console.log(state);

	return {songs: state.songs};
}

export default connect(mapStateToProps)(SongList);
